import { BABYLON, AbstractViewer, DefaultViewer, ViewerModel, viewerGlobals, AnimationPlayMode, AnimationState } from "../../src";
import { ViewerConfiguration } from "../../src/configuration/configuration";
import { IModelAnimation } from "../../src/model/modelAnimation";
import { SceneManager } from "../../src/managers/sceneManager";

export const useNullEngine = true;

export class Helper {

    public static getNewViewerInstance(element: HTMLElement = Helper.getViewerContainer(), configuration?: ViewerConfiguration, useAbstractViewer?: boolean) {
        if (configuration) {
            configuration.extends = configuration.extends || "default";
        }
        if (useNullEngine) {
            if (useAbstractViewer) {
                return new NullEngineAbstractViewer(element, configuration);
            } else {
                return new NullEngineDefaultViewer(element, configuration);
            }
        } else {
            if (useAbstractViewer) {
                return new ImplementedAbstractViewer(element, configuration);
            } else {
                return new DefaultViewer(element, configuration);
            }
        }
    }

    public static createViewer(options?: ViewerConfiguration): AbstractViewer {
        if (Helper.viewer != null) {
            throw "The global instance of viewer should not be created more than once";
        }

        Helper.viewer = new DefaultViewer(Helper.getViewerContainer(), options);

        Helper.viewer.renderInBackground = true;

        return Helper.viewer;
    }

    public static disposeViewer() {
        if (Helper.viewer != null) {
            Helper.viewer.dispose();
            (Helper.viewer as any)= null;
        }
    }

    public static getViewerContainer() {
        return document.getElementById("renderCanvas") as HTMLElement;
    }

    public static getReferenceCanvas() {
        return document.getElementById("referenceCanvas") as HTMLCanvasElement;
    }

    public static getRenderImg() {
        var nodes = document.querySelectorAll(".renderImg");
        return nodes[nodes.length - 1] as HTMLImageElement;
    }

    public static getReferenceImg() {
        var nodes = document.querySelectorAll(".referenceImg");
        return nodes[nodes.length - 1] as HTMLImageElement;
    }

    public static getResultDisplay() {
        var nodes = document.querySelectorAll(".resultDisplay");
        return nodes[nodes.length - 1] as HTMLDivElement;
    }

    public static createMockMesh(viewer: AbstractViewer) {
        let scene = viewer.sceneManager.scene;
        let mat = new BABYLON.PBRMaterial('mock-material', scene);
        let mesh = BABYLON.MeshBuilder.CreateBox('mock-box', {
            width: 1, height: 1, depth: 1,
            updatable: false
        }, scene);
        mesh.material = mat;
        return mesh;
    }

    public static MockScreenCapture(viewer: AbstractViewer, data) {
        BABYLON.Tools.CreateScreenshot = function(viewer, camera, size, successCallback) {
            successCallback && successCallback(data || '');
        };
    }

    public static MockModelAnimation(model: ViewerModel, name: string) {
        model.getAnimations().push(new ModelAnimationMock(name));
    }

    public static mockScreenCaptureData() {
        return "data:image/png;base64,";
    }

    public static roundToDp(value: number, dp: number) {
        let multiplier = Math.pow(10, dp);
        return (Math.round(value * multiplier) / multiplier);
    }

    public static GetPBRMaterial(material: BABYLON.Material, assert): BABYLON.PBRMaterial {
        assert.ok(material instanceof BABYLON.PBRMaterial, "Model material is not a BABYLON.PBRMaterial");
        return material as BABYLON.PBRMaterial;
    }

    private static viewer: AbstractViewer;

}

export class ImplementedAbstractViewer extends AbstractViewer {
    protected _prepareContainerElement() {
        // noop
    }
}

export class NullEngineAbstractViewer extends AbstractViewer {

    protected _prepareContainerElement() {
        // noop
    }

    protected _initEngine() {
        let config: any = this.configuration.engine || {};

        // TDO enable further configuration
        config.engineOptions = config.engineOptions || {};

        // check for webgl2 support, force-disable if needed.
        if (viewerGlobals.disableWebGL2Support) {

            config.engineOptions.disableWebGL2Support = true;
        }

        config.engineOptions.renderWidth = 500;

        this.engine = new BABYLON.NullEngine(config.engineOptions);

        this.engine.getRenderingCanvas = () => {
            return this.canvas;
        };

        this.sceneManager = new SceneManager(this.engine, this.configurationContainer, this.observablesManager);

        if (!config.disableResize) {
            window.addEventListener('resize', this._resize);
        }

        if (this.configuration.engine && this.configuration.engine.adaptiveQuality) {
            var scale = Math.max(0.5, 1 / (window.devicePixelRatio || 2));
            this.engine.setHardwareScalingLevel(scale);
        }

        this.engine.createCubeTexture = <any>function() { };

        this.engine.dispose = function() { };

        return Promise.resolve(this.engine);
    }
}

export class NullEngineDefaultViewer extends DefaultViewer {

    protected _initEngine() {
        let config: any = this.configuration.engine || {};
        // TDO enable further configuration
        config.engineOptions = config.engineOptions || {};

        // check for webgl2 support, force-disable if needed.
        if (viewerGlobals.disableWebGL2Support) {

            config.engineOptions.disableWebGL2Support = true;
        }

        config.engineOptions.renderWidth = 500;

        this.engine = new BABYLON.NullEngine(config.engineOptions);
        this.engine.getRenderingCanvas = () => {
            return this.canvas;
        };

        this.sceneManager = new SceneManager(this.engine, this.configurationContainer, this.observablesManager);

        if (!config.disableResize) {
            window.addEventListener('resize', this._resize);
        }

        if (this.configuration.engine && this.configuration.engine.adaptiveQuality) {
            var scale = Math.max(0.5, 1 / (window.devicePixelRatio || 2));
            this.engine.setHardwareScalingLevel(scale);
        }

        this.engine.createCubeTexture = <any>function() { };

        this.engine.dispose = function() { };

        return Promise.resolve(this.engine);
    }
}

/**
 * A mock implementation of the babylon viewer's animation interface
 * Used to test the Movel itself.
 * @class ModelAnimationMock
 * @implements {BabylonViewer.IModelAnimation}
 */
class ModelAnimationMock implements IModelAnimation {
    public state = 0;
    public currentFrame = 0;
    public fps = 60;
    public frames = 100;
    public speedRatio = 1;
    public playMode = AnimationPlayMode.ONCE;

    constructor(public name: string) {
        this.state = AnimationState.INIT;
    }

    public reset() {
        this.currentFrame = 0;
        this.state = AnimationState.STOPPED;
    }
    public restart() {
        this.goToFrame(0);
    }

    public start() {
        this.state = AnimationState.PLAYING;
    }
    public stop() {
        this.state = AnimationState.STOPPED;
    }
    public dispose() {

    }
    public goToFrame(frame: number) {
        this.currentFrame = frame;
    }
    public pause() {
        this.state = AnimationState.PAUSED;
    }
}
